import './App.css';
import Header from './components/header/header';
import Navbar from './components/navbar/navbar';
import { BrowserRouter, Route } from 'react-router-dom';
import Profile from './components/content/Profile/Profile';
import Posts from './components/content/MyPosts/Posts';
import Dialogs from './components/content/dialogs/Dialogs';

function App() {
  let postsData = [
    { id: 1, name: 'Anar', text: 'Hi', likesCount: '0'  },
    { id: 2, name: 'Anar', text: 'Vova', likesCount: '0' },
    { id: 3, name: 'Anar', text: '1337', likesCount: '0' },
]

let dialogsData = [
  { id: 1, name: 'Anar' },
  { id: 2, name: 'Vova' },
  { id: 3, name: 'Danya' },
]

let messagesData = [
  { id: 1, message: 'Hello' },
  { id: 2, message: 'How are you ?' },
  { id: 3, message: 'My name is Anar' },
]

  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <div className="blockContent">

          {/* <Route path='/profile' component={Profile} /> */}
          {/* <Route path='/posts' component={Posts} />
          <Route exact path='/messages' component={Dialogs} /> */}

          <Route path='/profile' render = {() => <Profile />}/>
          <Route path='/posts' render = {() => <Posts postsData = {postsData}/> } />
          <Route exact path='/messages' render = {() => <Dialogs messagesData = {messagesData} dialogsData = {dialogsData} />} />
        </div>
        <Navbar />


      </div>
    </BrowserRouter>

  );
}

export default App;
